import React from 'react'

const Logo = () => {
    return (

            // <svg xmlns="http://www.w3.org/2000/svg" height="130" width="500">
            //         <defs>
            //             <linearGradient id="grad1" x1="0%" y1="0%" x2="100%" y2="0%">
            //             <stop offset="0%" style="stop-color:rgb(255,255,255);stop-opacity:1" />
            //             <stop offset="100%" style="stop-color:rgb(0,51,0);stop-opacity:1" />
            //             </linearGradient>
            //         </defs>
            //         <ellipse cx="100" cy="70" rx="85" ry="55" fill="url(#grad1)" />
            //         <text fill="#ffffff" font-size="45" font-family="Verdana" x="50" y="86">OCART</text>
            //         Sorry, your browser does not support inline SVG.
            // </svg>
            <svg height="130" width="200" >
                <defs>
                    <linearGradient id="grad1" x1="0%" y1="0%" x2="100%" y2="0%">
                    <stop offset="0%"
                    style={{stopColor: 'rgb(0,0,0)', stopOpacity: 1}} />
                    <stop offset="100%"
                    style={{stopColor: 'rgb(0,255,255)', stopOpacity: 1}} />
                    </linearGradient>
                </defs>
                <ellipse cx="100" cy="70" rx="85" ry="55" fill="url(#grad1)" />
                <text fill="#ffffff" fontSize="35" fontFamily="Verdana"
                x="35" y="86">OCART</text>
                Sorry, your browser does not support inline SVG.
            </svg>

    )
}

export default Logo
